-- ----------------------------
-- Table structure for teacher
-- ----------------------------
DROP TABLE IF EXISTS `teacher`;
CREATE TABLE `teacher` (
  `id` varchar(50) NOT NULL,
  `name` varchar(50) DEFAULT NULL,
  `phone_number` varchar(20) NOT NULL COMMENT '手机号',
  `password` varchar(255) NOT NULL COMMENT '密码',
  `id_number` varchar(20) DEFAULT NULL,
  `qq` varchar(20) DEFAULT NULL,
  `school_id` bigint(20) DEFAULT NULL,
  `id_card_image_url` varchar(200) DEFAULT NULL,
  `student_card_image_url` varchar(200) DEFAULT NULL,
  `status` tinyint(4) DEFAULT NULL,
  `province_id` int(11) DEFAULT NULL,
  `city_id` int(11) DEFAULT NULL,
  `weixin` varchar(20) DEFAULT NULL,
  `subjects` varchar(20) DEFAULT NULL,
  `grades` varchar(20) DEFAULT NULL,
  `bank_card` varchar(50) DEFAULT '' COMMENT '银行卡',
  `bank` varchar(100) DEFAULT '' COMMENT '开户银行',
  `alipay` varchar(100) DEFAULT '' COMMENT '支付宝账号',
  `course_time` varchar(100) DEFAULT '' COMMENT '可授课时间',
  `self_description` text COMMENT '自我描述',
  `course_year` int(50) DEFAULT '0' COMMENT '教龄',
  `course_area` varchar(100) DEFAULT '' COMMENT '可教授地区',
  `mingshihui` tinyint(4) DEFAULT '0' COMMENT '名师汇老师（VIP）',
  `xingjihua` tinyint(4) DEFAULT '1' COMMENT '星计划老师（教师端）',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `operater` varchar(50) DEFAULT '' COMMENT '操作者',
  `avatar_url` varchar(200) DEFAULT NULL COMMENT '头像url',
  `gender` int(11) DEFAULT NULL COMMENT '性别 1：男 2：女',
  `star` int(11) DEFAULT NULL COMMENT '星级',
  `teacher_identify` int(11) DEFAULT NULL COMMENT '教师身份 1:教师 2:学生',
  `point` int(11) DEFAULT NULL COMMENT '积分',
  `qrcode_url` varchar(200) DEFAULT NULL COMMENT '二维码url',
  `device_id` varchar(100) DEFAULT NULL COMMENT '设备id',
  `last_task_time` datetime DEFAULT NULL,
  `last_device_id` varchar(100) DEFAULT NULL,
  `last_device_type` varchar(100) DEFAULT NULL,
  `complete_new_user_task` tinyint(4) DEFAULT NULL,
  `online_status` varchar(1) DEFAULT NULL,
  `cur_org_id` int(11) DEFAULT NULL,
  `capacity_test_status` tinyint(4) DEFAULT '0' COMMENT '0 未处理 1：已处理',
  `capacity_test_complete_time` datetime DEFAULT NULL COMMENT '完成能力测试时间',
  `capacity_test_give_point` int(11) DEFAULT '0' COMMENT '能力测试赠送积分',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='教师用户表';

